function rrInit(canvas, tileSize, widthTiles, heightTiles) {
	rInit(canvas, tileSize*widthTiles, tileSize*heightTiles);
	rrTileSize = tileSize;
	rrWidthTiles = widthTiles;
	rrHeightTiles = heightTiles;
}
